import React from "react";
import { Button } from "antd";

export default class HomePage extends React.Component {
  render() {
    return (
      <div>
        <Button type="primary" block>
          Buy
        </Button>
        <Button type="secondary" block>
          Sell
        </Button>
      </div>
    );
  }
}
